import React from "react";
 const ContactList = (props) => {

    const renderContactList = props.contacts.map((contact) => {
        return(
            <div className="item">
                <div className="content">
                    <div className="Header"></div>
                </div>
            </div>
        )
    })
     return(
         <div className="ui celled list">
             CONTACT LIST
         </div>
     )
 }
 
 export default ContactList;
